import { StyleSheet } from "react-native";

export default StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
  },
  inputContainer: {
    height: 400,
    marginTop: "45%",
    marginLeft: "5%",
    marginRight: "5%",
    backgroundColor: "#FFFFFF",
    borderRadius: 10,
  },
  shareCardData: {
    padding: 10,
    height: 45,
    width: "100%",
    paddingTop: "2%",
    paddingLeft: "10%",
    paddingRight: "10%",
    marginBottom: "2%",
    marginTop: "2%",
    backgroundColor: "#FFFFFF",
  },
  alanyticView: {
    flexDirection: "row",
    justifyContent: "space-between",
  },

  itemCardText: {
    color: "#374046",
    fontStyle: "italic",
  },
  textInput: {
    borderRadius: 10,
    height: 50,
    color: "#212121",
    borderWidth: 1,
    fontSize: 18,
    margin: 11,
    marginTop: 50,
    paddingLeft: 10,
  },
});
